import React from 'react';

function CardDetail(props){

    return (
        <div style={{display: props.cardDetailVisible ? 'block' : 'hidden'}} id='card-detail-container'>
            <div id='card-detail'>
                <h1>{props.dailyDetails.humidity}</h1>
                <h2>{props.dailyDetails.moonrise}</h2>
                <h3>{props.dailyDetails.moonset}</h3>
                <h4>{props.dailyDetails.clouds}</h4>
            </div>
        </div>
    )

}

export default CardDetail;
